commands.jump_1:
let count = 0;
function jumpLoop() {
  if(count >= 1) return;
  bot.setControlState('jump', true);
  setTimeout(() => {
    bot.setControlState('jump', false);
    count++;
    setTimeout(jumpLoop, 300);
  }, 300);
}
jumpLoop();

